title is available to the users. 


import org.eclipse.swt.widgets.Display;
import org.eclipse.swt.widgets.Shell;

public class LongTitleTest
{
    public static void main(String[] args)
    {
        Display display = new Display();

        Shell shell = new Shell(display);
        shell.setText("Important Info Here!  All of this text must be shown in the hover text, but it gets truncated (denoted by the dot.dot.dot).  Important Info Here!");
        shell.setMinimumSize(250, 250);
        shell.setSize(500, 500);
        shell.open();

        while (!shell.isDisposed())
        {
            if (!display.readAndDispatch())
            {
                display.sleep();
            }
        }
        display.dispose();
    }
}

