The test case here has two working sets, each containing several projects, displayed in the Project Explorer, with "Show Top Level Elements" set to "Working Sets". 

Whenever a Java type is opened, the Java type in the viewer "becomes" a working copy, which causes the PackageExplorerContentProvider to respond in its elementChanged() method. Currently, elementChanged() first checks if the input was deleted (PackageExplorerContentProvider.inputDeleted()). If inputDeleted() returns true, then it forces a complete refresh of the viewer. This causes jumpiness if the viewer is scrolled outside of the scope of the current selection. 

The inputDeleted() method is already updated for the JDT WorkingSetModel: 

private boolean inputDeleted() {
   if (fInput == null)
      return false;
   if ((fInput instanceof IJavaElement) && ((IJavaElement) fInput).exists())
      return false;
   if ((fInput instanceof IResource) && ((IResource) fInput).exists())
      return false;
   if (fInput instanceof WorkingSetModel)
      return false;		
   postRefresh(fInput, ORIGINAL, fInput);
   return true;
}

However, as of 3.2.1, the Project Explorer supports working sets, using the Platform/UI's support for the IWorkingSet API. Because the PackageExplorerContentProvider doesn't recognize IWorkingSet and return false, the viewer is structurally refreshed for each opened Java file. 

Instead, the inputDeleted() method should check for IWorkingSet:

	private boolean inputDeleted() {
		if (fInput == null)
			return false;
		if ((fInput instanceof IJavaElement) && ((IJavaElement) fInput).exists())
			return false;
		if ((fInput instanceof IResource) && ((IResource) fInput).exists())
			return false;
		if (fInput instanceof WorkingSetModel)
			return false;
		if (fInput instanceof IWorkingSet)
			return false;
		postRefresh(fInput, ORIGINAL, fInput);
		return true;
	}

I will attach a patch.

This is related to Data-Binding Framework.

In an RCP project, I encountered a missing feature that my client wants. It is required for several screens that use data-binding to update calculations off of text control values.

The client wants calculations to get updated when hitting Enter or Carriage Return on a text control. Currently, they only get updated when tabbing off.

I implemented a fix in TextObservableValue by updating the keyListener code:

keyListener = new KeyListener() {
	public void keyPressed(KeyEvent e) {
		if (e.character == SWT.ESC && bufferedValue != null) {
			// Revert the value in the text field to the model value
			text.setText(bufferedValue);
		}
                // Begin new code
		String oldValue = bufferedValue;
		String newValue = text.getText();
		if (e.character == '\r' || e.character == '\n') {
			if (!newValue.equals(oldValue)) {
				fireValueChange(Diffs.createValueDiff(oldValue,
						newValue));
			}

		}
                // End new code
	}

	public void keyReleased(KeyEvent e) {
	}
};

I would like to contribute this fix, but first, I would like to get your opinion on how to generalize this solution. 
For example:
-Is it better to allow programmers to specify characters that fire-off data-binding events in a text control, or should we keep Enter and Carriage Return hard-coded?
-What other widgets need this fix/customization? For example, editable combos are another candidate for this fix.
-Is this already done elsewhere?

Thank you,

Andy

